webpackJsonp([0x8ccf27755208],{389:function(a,n){a.exports={data:{markdownRemark:{html:'<h2>Hola Mundo</h2>\n<p>Después de un tiempo, después  de un buen tiempo de querer iniciar un blog por fin ha llegado ese día.\nClaro, no paso de la noche a la mañana. </p>\n<p>Tenía dos ideas iniciales: tener un blog personal sin ningun tipo de tema en específico o un blog técnico enfocado al área profesional, me he decidido por este último.</p>\n<p>La razón es bastante simple, es lo que hago diariamente, así que a pesar de tener algunos temores ("y si nadie lo lee?") mire algunos diseños de blogs y páginas web, diseñe el actual front end, saque mi editor de texto favorito <a href="https://code.visualstudio.com/">vscode</a>, leí toda la documentación de <a href="https://www.gatsbyjs.org/">gatsbyjs</a> (claro si no era en react, en qué? <del>php?</del> ) y manos a la obra, después de todo si no hacia mi propio blog sentiría que algo faltaba. Algunos de ustedes seguro entenderán.</p>\n<p>Por ahora el blog es mi <strong>MVP</strong> (Minimum Viable Product) - Mínimo Producto Viable, por lo tanto, aún está en desarrollo, a la espera de nuevos características dependiendo de la retroalimentación. </p>\n<p>Con muchos planes por delante pero ahora mismo decir <strong>Hola Mundo</strong> desde mi primer post.</p>\n<div class="gatsby-highlight">\n      <pre class="language-javascript"><code><span class="token punctuation">(</span><span class="token keyword">function</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">{</span>\n  console<span class="token punctuation">.</span><span class="token function">log</span><span class="token punctuation">(</span><span class="token string">"Hola Mundo"</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n<span class="token punctuation">}</span><span class="token punctuation">)</span><span class="token punctuation">(</span><span class="token punctuation">)</span>\n</code></pre>\n      </div>\n<p>Si tienes algún comentario hazlo saber, puedes contactarme en <a href="https://twitter.com/HansLGarcia">twitter</a> o <a href="https://www.linkedin.com/in/hansgarcia/">linkedIn</a></p>',frontmatter:{id:"1",titleid:"Hola Mundo",title:"Hola Mundo",date:"February 17, 2018",path:"/hola-mundo",tags:["blog","intro"],excerpt:"Escribir un blog puede ser dificil pero como toda persona me gustan los retos, en este articulo quiero presentarme a la comunidad y decir Hello World"}}},pathContext:{prev:null,next:null}}}});
